import {TopicWrapper, TopicItem} from "../style";

class Topic extends Component {
    render() {
        return (
            <TopicWrapper>
                <TopicItem>
                    <img 
                    className="topic-pic"
                    src="https://ss2.bdstatic.com/70cFvnSh_Q1YnxGkpoWK1HF6hhy/it/u=1074417518,1198280004&fm=26&gp=0.jpg" />
                    社会热点
                </TopicItem>
                <div>更多热门专题</div>
            </TopicWrapper>
        )
    }
}

export default Topic
